import React from 'react';
import './JumboBanner.css';

const JumboBanner = () => {
  return (
    <div className="JumboBanner">
      <img alt="" data-src="https://images.squarespace-cdn.com/content/v1/5e9fa98348d28b20b3f39b36/1587972481582-4IDI8MBIM3XQX0TIQIXR/ke17ZwdGBToddI8pDm48kB22_VvoyFCRbPbLc__z6BN7gQa3H78H3Y0txjaiv_0fDoOvxcdMmMKkDsyUqMSsMWxHk725yiiHCCLfrh8O1z4YTzHvnKhyp6Da-NYroOW3ZGjoBKy3azqku80C789l0s0XaMNjCqAzRibjnE_wBllWPKxPwXRrgPSJ9-HJGJRIPBbQUFoxZAAiruvptd7uDw/drone+shot+3.jpg" data-image="https://images.squarespace-cdn.com/content/v1/5e9fa98348d28b20b3f39b36/1587972481582-4IDI8MBIM3XQX0TIQIXR/ke17ZwdGBToddI8pDm48kB22_VvoyFCRbPbLc__z6BN7gQa3H78H3Y0txjaiv_0fDoOvxcdMmMKkDsyUqMSsMWxHk725yiiHCCLfrh8O1z4YTzHvnKhyp6Da-NYroOW3ZGjoBKy3azqku80C789l0s0XaMNjCqAzRibjnE_wBllWPKxPwXRrgPSJ9-HJGJRIPBbQUFoxZAAiruvptd7uDw/drone+shot+3.jpg" data-image-dimensions="2500x1393" data-image-focal-point="0.5,0.5" data-load="false" data-parent-ratio="2.6" style="width: 100%;height: 100%;object-position: 50% 50%;object-fit: cover;" class="" data-image-resolution="2500w" src="https://images.squarespace-cdn.com/content/v1/5e9fa98348d28b20b3f39b36/1587972481582-4IDI8MBIM3XQX0TIQIXR/ke17ZwdGBToddI8pDm48kB22_VvoyFCRbPbLc__z6BN7gQa3H78H3Y0txjaiv_0fDoOvxcdMmMKkDsyUqMSsMWxHk725yiiHCCLfrh8O1z4YTzHvnKhyp6Da-NYroOW3ZGjoBKy3azqku80C789l0s0XaMNjCqAzRibjnE_wBllWPKxPwXRrgPSJ9-HJGJRIPBbQUFoxZAAiruvptd7uDw/drone+shot+3.jpg?format=2500w"></img>
